content:
Từ một người đầu tư Crypto currency
- Ưu điểm:
+ Bố cục rõ ràng, nội dung gọn gàng khúc triết. Quyển sách gần như là một lược sử phát triển của Bitcoin, rất cần thiết cho những người tin vào Bitcoin, đầu tư crypto currency và lý do tại sao nên tin vào nó.
- Nhược điểm:
+ Bìa sách kém chất lượng. tôi rất không hiểu tại sao một quyển sách dày, giá không phải là rẻ mà không đầu tư cho cái bìa;
+ Keo gáy sách không đều, dễ bị bong;
+ Một số lỗi chính tả;
- Kết luận:
Nên mua. Phù hợp với độc giả phổ thông và chuyên sâu tìm hiểu về Crypto Currency.
